import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <Link to="/">Login</Link> | 
      <Link to="/register">Register</Link> | 
      <Link to="/transactions">Transactions</Link> | 
      <Link to="/summary">Summary</Link> | 
      <Link to="/budget">Budget</Link>
    </nav>
  );
};

export default Navbar;
